import React from 'react';
import '../CSS/home.css'; // Import the CSS for styling
import backgroundImage from './pexels-tima-miroshnichenko-5452196.jpg'; // Ensure the path is correct
import styles from '../CSS/login.module.css'; // Import the CSS module // Import the CSS module
import Footer from '../Components/footer'

function LandingPage() {
  return (
    <div className="background" style={{ backgroundImage: `url(${backgroundImage})` }}>
      <div className="white-overlay">
        <div className="content">
          <h1>Welcome to <span style={{color}}>Our world </span>Oasis</h1>
          <p>Explore and discover our services.</p>
        </div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <a href='/signup'> <button className={styles.loginButton} type="submit" >
          Sign up
        </button></a><br/><br/>
        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<a href='/login'><button className={styles.loginButton} type="submit">
        Login
        </button></a>
        </div>
      </div>
      <Footer/>


    </div>
  );
}

export default LandingPage;
